import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
  MDBNavItem,
  MDBNavLink,
  MDBNavbarToggler,
  MDBCollapse,
  MDBMask,
  MDBRow,
  MDBCol,
  MDBView,
  MDBContainer,
  MDBFormInline,
  MDBAnimation,
  MDBBtn, MDBCard, MDBCardBody, MDBCardImage, MDBCardTitle, MDBCardText
} from "mdbreact";
import CardExample from './event1';

class Brochure extends React.Component {
    render() {
        return(

            <div>
            
        
            <MDBContainer>
            <h2>Brochure</h2>
            <br/><br/>
                <MDBRow>
                    <MDBCol md="6" lg="6" sm="12">Lorem ipsum, dolor sit amet consectetur adipisicing elit. Necessitatibus placeat quae esse accusantium ducimus sit ex alias animi in nihil officiis aperiam sapiente exercitationem temporibus atque, numquam sint repellendus velit.</MDBCol>
                    
                    <MDBCol md="6" lg="6" sm="12" align="center"><a href="https://www.google.com" target="_blank"><MDBBtn color="black">Download Now</MDBBtn></a></MDBCol>
                </MDBRow>
                <br/><br/>
            </MDBContainer>
            </div>
        );
    }
}

export default Brochure;
